import React from 'react'
const api = {
    key: "155333348469e1d6dc3323590ede30b2",
    base: "https://api.openweathermap.org/data/2.5/"
};

const [weather, setWeather] = useState({});

useEffect(() => {
    fetch(`${api.base}weather?q=Allentown,PA&units=imperial&APPID=${api.key}`)
        .then(res => res.json())
        .then(data => {
            console.log(data);
        }
    )
}, []);

const Weather = () => {
  return (
    <div>Weather</div>
  )
}

export default Weather
